import React from 'react';
import Frame70 from './Frame70';

const Banner = () => {
  return (
    <div
      style={{
        width: '100%',
        maxWidth: '1440px',
        minHeight: '300px',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        overflow: 'hidden',
        margin: '0 auto',
        background: 'rgba(210, 52, 41, 1)',
        position: 'relative',
      }}
    >
      <Frame70 />
    </div>
  );
};

export default Banner;
